This sample shows how to call GetTargetAsync and parse the result.

TokenCredential credential = new DefaultAzureCredential();
TargetsClient client = new TargetsClient(Guid.Parse("73f411fe-4f43-4b4b-9cbd-6828d8f4cf9a"), credential);

Response response = await client.GetTargetAsync("<resourceGroupName>", "<parentProviderNamespace>", "<parentResourceType>", "<parentResourceName>", "<targetName>", null);

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
Console.WriteLine(result.GetProperty("properties").GetProperty("<key>").ToString());

