This sample shows how to call GetTargetsAsync and parse the result.

TokenCredential credential = new DefaultAzureCredential();
TargetsClient client = new TargetsClient(Guid.Parse("73f411fe-4f43-4b4b-9cbd-6828d8f4cf9a"), credential);

await foreach (BinaryData item in client.GetTargetsAsync("<resourceGroupName>", "<parentProviderNamespace>", "<parentResourceType>", "<parentResourceName>", null, null))
{
    JsonElement result = JsonDocument.Parse(item.ToStream()).RootElement;
    Console.WriteLine(result.GetProperty("properties").GetProperty("<key>").ToString());
}

This sample shows how to call GetTargetsAsync with all parameters and parse the result.

TokenCredential credential = new DefaultAzureCredential();
TargetsClient client = new TargetsClient(Guid.Parse("73f411fe-4f43-4b4b-9cbd-6828d8f4cf9a"), credential);

await foreach (BinaryData item in client.GetTargetsAsync("<resourceGroupName>", "<parentProviderNamespace>", "<parentResourceType>", "<parentResourceName>", "<continuationToken>", null))
{
    JsonElement result = JsonDocument.Parse(item.ToStream()).RootElement;
    Console.WriteLine(result.GetProperty("properties").GetProperty("<key>").ToString());
    Console.WriteLine(result.GetProperty("location").ToString());
    Console.WriteLine(result.GetProperty("id").ToString());
    Console.WriteLine(result.GetProperty("name").ToString());
    Console.WriteLine(result.GetProperty("type").ToString());
    Console.WriteLine(result.GetProperty("systemData").GetProperty("createdBy").ToString());
    Console.WriteLine(result.GetProperty("systemData").GetProperty("createdByType").ToString());
    Console.WriteLine(result.GetProperty("systemData").GetProperty("createdAt").ToString());
    Console.WriteLine(result.GetProperty("systemData").GetProperty("lastModifiedBy").ToString());
    Console.WriteLine(result.GetProperty("systemData").GetProperty("lastModifiedByType").ToString());
    Console.WriteLine(result.GetProperty("systemData").GetProperty("lastModifiedAt").ToString());
}

